import "./styles/NavBar.css"
import "./styles/Home.css"
import Green from "./images/green.png"

const NavBar = () => {
    return (
        <div className="nav-box">
            <div className="left-home-logo">
                <img src={Green} width="80px" alt="zcp-symbol"></img>
                <h1>Greenvesting</h1>
            </div>


        </div>
    );
}

export default NavBar;
